import axios from 'axios';
import { API_PREFIX, LOGIN_DATA } from '../utils/utils';

export default function login() {
  const promise = axios.post(`${API_PREFIX}/login/`, LOGIN_DATA);
  const response = promise.then((response) => response.data);
  return response;
};
